import React from 'react';
import { FirstName , LastName } from './App'
function ComC(){
  return (
    <>
    <FirstName.Consumer>
    {function (fname){
      return <h1>Hello , Welcome in {fname}</h1>
    }}
    
    </FirstName.Consumer>
    </>
  )
}


export default ComC;
